onClipEvent(load){
   声音 = "";
   霰弹值 = 1;
   子弹散射度 = 0;
   发射效果 = "";
   子弹种类 = "一瞬千击多次";
   子弹威力 = (_parent._parent.空手攻击力* 0.1 + 100) * (1 + _parent._parent.技能等级 * 1);
	if(_parent._parent.mp攻击加成){
		子弹威力 += _parent._parent.mp攻击加成;
	}
   子弹速度 = 0;
   击中地图效果 = "";
   Z轴攻击范围 = 60;
   击倒率 = 1;
   击中后子弹的效果 = "空手攻击火花";
   击退初速度 = 12;
   if(_parent._parent.是否为敌人 == true)
   {
      子弹敌我属性 = false;
   }
   else
   {
      子弹敌我属性 = true;
   }
   var myPoint = {x:this._x,y:this._y};
   _parent.localToGlobal(myPoint);
   _root.gameworld.globalToLocal(myPoint);
   shootX = myPoint.x;
   shootY = myPoint.y;
   _root.子弹区域shoot(声音,霰弹值,子弹散射度,发射效果,子弹种类,子弹威力,子弹速度,Z轴攻击范围,击中地图效果,_parent._parent._name,shootX,shootY,_parent._parent.Z轴坐标,子弹敌我属性,击倒率,击中后子弹的效果,击退初速度);
}

onClipEvent(enterFrame){
   _parent.攻击时按键四向移动(40 * (1 + Number(_parent._parent.技能等级) / 20),60 * (1 + Number(_parent._parent.技能等级) / 20));
}

onClipEvent (load) {
	_parent._parent.skillShadow = this;
	if (!_root.是否阴影)
	{
		this._visible = false;
	}
	缩放乘数 = 3.611 * 175 / _parent._parent.身高;
	if (_root.技能浮空 == true && _parent._parent._name == _root.控制目标)
	{
		if (_parent._parent.浮空)
		{
			this._y = 233.05 + (_parent._parent.起始Y - _parent._parent._y - _parent._parent.垂直速度) * 缩放乘数;
		}
	}
}
onClipEvent (enterFrame) {
	if (_root.是否阴影 && !_parent.落地)
	{
		this._y = 233.05 + (_parent._parent.起始Y - _parent._parent._y - _parent._parent.垂直速度) * 缩放乘数;
	}
	else
	{
		this._y = 233.05;
	}
}
